eSeconds\":5}},\"videoDetails\":{\"videoId\":\"BLIDS27ZJhg\",\"title\":\"Japanese Street Food - OMELET RICE Kichi Kichi Omurice Kyoto Japan\",\"lengthSeconds\":\"903\",\"keywords\":[\"japan\",\"japanese\",\"omurice\",\"omelet rice\",\"eggs\",\"egg\",\"egg rice\",\"omelette rice\",\"omlet\",\"omelette\",\"omelet\",\"japanese omelet\",\"japanese omelette\",\"scrambled eggs\",\"japan street food\",\"japanese street food\",\"kyoto\"],\"channelId\":\"UCHKVXtT1YBCYUnnr4apqXfg\",\"isOwnerViewing\":false,\"shortDescription\":\"Omurice or omu-rice (オムライス Omu-raisu) is an example of yōshoku (a Western-influenced style of Japanese cuisine) consisting of an omelette made with fried rice and usually topped with ketchup. With omu and raisu being contractions of the words omelette and rice, the name is an example of Gairaigo. It is a popular dish both commonly cooked at home and often found at western style diners in Japan. The dish was brought to Korea during Japanese rule, and today it is a fixture on gimbap restaurant menus throughout South Korea, where it is rendered as \\\"오므라이스 (omeuraiseu)\\\" in Hangul. Omurice is also popular in Taiwan, another territory formerly occupied by Japan. Children, in particular, enjoy omurice, and it is often featured in okosama-ranchi or kids' meals.\\n\\nOmurice is said to have originated around the turn of the 20th century at a western style restaurant in Tokyo's Ginza district called Renga-tei, inspired by chakin-zushi.\\n\\nIt has been featured in popular culture such as the Japanese film Tampopo and the Korean TV series Rooftop Prince, and more recently in the manga Shokugeki no Soma.\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/BLIDS27ZJhg\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBopc64YNDeABISz-sTjbCa1E5ypQ\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/BLIDS27ZJhg\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAY