urice is said to have originated around the turn of the 20th century at a western style restaurant in Tokyo's Ginza district called Renga-tei, inspired by chakin-zushi.\n\nIt has been featured in popular culture such as the Japanese film Tampopo and the Korean TV series Rooftop Prince, and more recently in the manga Shokugeki no Soma.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/BLIDS27ZJhg/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBopc64YNDeABISz-sTjbCa1E5ypQ","width":168,"height":94},{"url":"https://i.ytimg.com/vi/BLIDS27ZJhg/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDBaaoEejXRosHCTrRQnjPC0EM37Q","width":196,"height":110},{"url":"https://i.ytimg.com/vi/BLIDS27ZJhg/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAWL1c5YBdPV1pD0XFur4hCusyi-g","width":246,"height":138},{"url":"https://i.ytimg.com/vi/BLIDS27ZJhg/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBy6XljyJq37GRptejZzRl5860y7g","width":336,"height":188}]},"useCipher":false,"averageRating":4.8719964,"allowRatings":true,"viewCount":"13014514","author":"Travel Thirsty","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"5000","endTimeMs":"904000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/HKVXtT1YBCYUnnr4apqXfg/featured_channel.jpg?v=57559eb6","width":43,"height":36}]},"trackingParams":"CEgQ8zciEwjM0bbc_KLsAhUoxEwCHVFuDuQ=","navigationEndpoint":{"clickTrackingParams":"CEgQ8zciEwjM0bbc_KLsAhUoxEwCHVFuDuQyAml2","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCHKVXtT1YBCYUnnr4apqXfg","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611}},"browseEndpoint":{"browseId":"UCHKVXtT1YBCYUnnr4apqXfg"}},"channelName":"Travel Thirsty","subscribeButton":{"subscribeButtonRenderer":{"buttonText":{